import React,{useState} from 'react'
import {Container,} from "react-bootstrap";
import SlideShow from "./SlideShowSlideShow"

function Test() {
    const [page,setPage] = useState(0);
  const TestTitle = ["Select which image has tumor", "Select which image has lungs" , "Select which image is correct annotated"]
  
  if ( page === 1 ) {
    <SlideShow></SlideShow>
  } 
   
 return (
    <Container fluid>
        <div className="test-container">
        <div className="header">
            <h1>hello</h1>
        </div>
        <div className="body" style={{flex:"60%"}}>askdhasksd</div>
        <div className="footer">
            <button className="previous" disabled={page === 0}
        onClick={()=>{
          setPage((currentPage)=>currentPage - 1);
        }}>&laquo;Previous</button>
            <button className="next" disabled={page === TestTitle.length -1}
        onClick={()=>{
          setPage((currentPage)=>currentPage + 1);
        }} >Next&raquo;</button>
        </div>



        </div>
       

    </Container>
  )
}

export default Test;
